						["TI"] = "Weary Veteran",
						["AC"] = true,
						["TX"] = "Koruz is a veteran of many wars, a fact that is reflected in his appearance and attitude. He tends to look a bit tired.\nHis physique is still admirable not mentioning his age.",
					},
					["3"] = {
