			["character"] = {
				["CU"] = "-Broken nose , two vicious slashes to each side of the torso , mending\n-Speaks in a low and dead tone\n",
				["CO"] = "-And again new art\n-Guild is recruiting ! /w\n-Very friendly OOC\n-Last name is intended\n\n\n",
				["RP"] = 1,
				["LC"] = "enUS",
