						["TI"] = "Runes of Old",
						["TX"] = "Bright, intricate and woven into various patterns, copious amounts of runes flicker on his skin, all with different purpose and shapes.\n\nA runestick is carried with him, alongside several jars of special inks that runes are marked with.",
