			["about"] = {
				["BK"] = 5,
				["T3"] = {
					["PH"] = {
						["IC"] = "Ability_Warrior_StrengthOfArms",
						["BK"] = 1,
						["TX"] = "It would be nearly impossible to find this draenei anything other than intimidating when you perceive him, but that couldn’t be further from the truth. His imposing height, trained physique and distant stare is often an indicator that he is no stranger to battle, but in reality, his calm disposition emanates kindness that is unmistakable. A tall giant with a golden heart whom has a penchant for showering strangers with encouraging words and making a difference in the world as we know it.\n\nWhile his large azure eyes often appear lost, they always light up with welcoming glee in most situations, being a recognizable feature upon a masked face that always tends to remain a mystery to many alive. The fortunate few who may have been granted the opportunity to see his beloved scarf anywhere else but on his features can determine that his visage is unscathed and considerably soft in appearance which might make one wonder what the cause for concealment is. His horns are arched forward and rather similar to those of an ox, which are without cracks or malformations and stand out rather well.\n\nWoven together are stark tresses of white that drop down in waves of silken strands that are well maintained, which have a habit of becoming unruly after a prolonged while of activity. The tail has few locks that tend to escape the containment of the tail, separating themselves and running freely down his shoulders instead. The remainder of hair flows down in long strands, with some being shorter than others in comparison, but still being tamed in a casual manner. One could detect the vague floral scent that had seeped into his hair, occasionally indulging himself in products that make the mane less tainted by the harsh circumstances of the outside world.\n\nLike many of his ilk, he has witnessed gruesome ordeals that have shaped him through the years, having trained himself on from a very early age and having maintained his ideal physique which makes him unequivocally a formidable foe that is likely to end a battle within seconds. His pale body displays a sufficient amount of muscles which makes it relatively impressive, but has not exceeded the limit, which gave him plenty of agility that he combines with deadly strikes and arcane magic that can quickly turn the tide in battle. His hooves are reinforced with layers of armor and serve as protection and as a weapon simultaneously, much like his tail which is broad at its base but turns out to be extremely long and thinner at its end.\n\nRunes are the most unique trait as they cover nearly every inch of his body, littering his white skin in colorful symbols that all have different shapes, sizes and purposes, but all luminously glow despite their locations. An intelligent mind can quickly conclude that his lack of clothing coincides with the runes, forming an obstacle for the runes which often results in tragic consequences. Those familiar with the use of magic can most certainly feel the arcane aura he emanates, which is quite strong, but not as potent as that of a full-fledged mage.",
