		["06052228105TqYg"] = {
			["character"] = {
				["CU"] = "Pensive",
				["CO"] = "Running = Jogging ic,\nZen Flight/Inner Truth = Meditating,\nAlways Approachable! \n\nSanity: 92%",
				["RP"] = 1,
				["LC"] = "enUS",
				["XP"] = 2,
