		["0420173512koTGs"] = {
			["character"] = {
				["CU"] = "A small smirk on her lips.",
				["CO"] = "This character is brand new, despite the silly amounts of fluff I've crammed into the profile. I love to write that stuff, what can I say?",
				["RP"] = 1,
				["LC"] = "enUS",
