					["4"] = 1,
					["6"] = 0,
				},
				["PE"] = {
					["1"] = {
						["AC"] = true,
						["TI"] = "Arcane power",
						["IC"] = "Spell_Arcane_Arcane04",
						["TX"] = "Minph has spent her entire life studying the dangerous arts of the arcane. Hard work and raw affinity has resulted in a skillful mage with a potent magical aura around her. Her form shimmering strangely on rare occasions. \nNow left to her own machinations, what will she do with such power?",
					},
					["3"] = {
						["AC"] = true,
						["TI"] = "Equipment",
						["IC"] = "inv_misc_treasurechest04b",
						["TX"] = "Staff:\nDesigned by herself, Minph's new mage staff brims with power! Charged runestones hovering at each end, supported by light, finely crafted steel with a high affinity for magic! She keeps it on her usually, hidden away by illusions.\n\nTome of magic:\nMinph always has a huge book with her. It appears enchanted and brimming with magic! She's often found reading in it and it is always kept close by.\n\nBelt and pouches:\nOften strapped along her travelling gear is a belt with many pouches and flasks! The majority of which are enchanted or magical in some other way.\n\nMagical backpack:\nMinph's magical backpack appears light and expensive, definitely just as magical as all her other stuff. Is it bigger on the inside?",
					},
					["2"] = {
						["AC"] = true,
						["TI"] = "Makeup",
						["IC"] = "achievement_FemaleGoblinhead",
						["TX"] = "Minph is always keeping her face fresh, clean and pretty! Subtle yet elegant makeup paired with lipstick and eyeliner ensures she's always presentable!",
					},
					["5"] = {
						["AC"] = true,
						["TI"] = "Expensive looks",
