		["1123000141QoFFB"] = {
			["character"] = {
				["CU"] = "Gloomy\n",
				["CO"] = "Always open to approaches when tagged IC\n\n/w me if i don't respond\n\nVoice ref: Enchanted Magus from Well of Eternity (Sam Riegel)",
				["RP"] = 2,
