			["about"] = {
				["T1"] = {
					["TX"] = "Blue like the sky on dead of winter, cold and endless in their depth her eyes are the most standing out feature. Calm for the mutual beings, but light up in fury when her weapons meet her foe in battle. Sharply sculptured jawline and chin, small nose sharp as an owls peak and cheekbones that barely stand out of her healthy pillowy cheeks could make one think she was born of the wilderness spirits. Dark, coal black hair falls beyond her shoulders and down her back to her waist.Tangled and messy for most part and sometimes decorated with feathers, bones and little trinkets of bronze.\n\nOn her right cheek is a set or symbols put together, tattoo'd on to her skin with black in. Some of its detail has been ruined, as a healed scar runs right down its middle. Whoever cut it, made sure the weapon's mark would never fade.\n\nHer attire and armor is common to that of any Frostwolf, made of old hides and fur of her fallen companions and slain prey. The armor and clothing she chooses, always carries the symbols of her Clan; The Frostwolves and sigils to honor the Ancient Wolf Lo'gosh. On her belt, she always carries small pouches, giving out the scent of herbs.\n\nSome n stuff:\n\n{link*https://www.deviantart.com/xewspaws/art/Drosera-Faewolf-666758569* Drosera by Mona}\n\n{link*https://www.deviantart.com/xewspaws/art/Under-the-mask-is-a-whimpface-802519374* Drozy by me}\n\n{link*https://www.deviantart.com/aerwindale/art/Drosera-of-the-Frostwolf-Clan-726099015*Drosera by Aerwindale}\n",
