						["TX"] = "Shrunken Heads, trinkets and beads litter this Trolls body. Evidence of her Loa worship in paramount.\n\nShe stands at roughly average height and weight.\nHer right arm holds a great fel burn, gnarled and twisted flesh, and clearly moves stiffly.\n\nThat aside she's overall very clearly a healthy, if aged, Troll. ",
