		["0311230016tcx3M"] = {
			["character"] = {
				["CU"] = "His neck bandaged, looking like a scarf perhaps. ",
				["CO"] = "Friendly & Approachable\nRunning IC\n",
				["RP"] = 1,
				["LC"] = "enUS",
