						["TX"] = "Dazdooga-Taluk\nTranslated from Zandali \"Fire Singer\" is a Spear of Jinyu make made from stone, makeing it heavy but not to heavy for a troll. The spear has a barb on the back of its blade made for catching arms, shields and weapons to wreatch them from the foes grip. The spear has resived a blessing from a Paladin\n\nRush-Thraze\n\"Cermonial blade\" in other dialects, is a wave bladed stabing sword, blessed by Lukou and forged by a Loa-bound smith its still nothing to sneaze at. \n\nKalimaste\nBlade of Yatu the Boneshield, Bulwark of Draktharon, is an antiacent helberd made from Cobalt and Titansteel, makeing the blade permanetly deadly sharp. the blade is enchaned and has the abbilty to call apone bone to assult the wields foe. Those gifted with magic can tell that the blade has a mind of its own, a result of all the blessings and magic thrown apone it.\n\nThis is only two exsamples from Viraks collection of weapons, with has Helberds, swords, axes maces, mauls and more.",
