				["PE"] = {
					["1"] = {
						["AC"] = true,
						["TI"] = "Looks older than she is.",
						["IC"] = "achievement_character_human_female",
						["TX"] = "Maeve has been through a lot, near death experiences, brawls to outright fighting. The stress has naturally built up upon her face, making her look a good 5-7 years older than she is.\n",
					},
					["3"] = {
						["AC"] = true,
						["TI"] = "No Honour.",
						["TX"] = "Maeve possesses no code of honour, if she fights she will fight to win, using any tricks she can use, kidney shots... Hair pulling, its all on the table with her.\n",
						["IC"] = "ability_cheapshot",
					},
					["2"] = {
						["AC"] = true,
						["TI"] = "Attitude",
						["TX"] = "Is rather locked up about her problems, never opening up to anybody unless cornered on the subject.\n\nOther than that, she's overall polite to those she doesnt know or people she outright knows. But she can be snappy and overall unpleasant to those who she has a bad impression of.\n\nShe's extremely impulsive, and may snap things before she thinks.",
						["IC"] = "ability_rogue_masterofsubtlety",
					},
					["5"] = {
						["AC"] = true,
						["TI"] = "Disgraced Noble / Evasive of past.",
						["IC"] = "achievement_battleground_battleforgilneas",
						["TX"] = "Recently she's become evasive of this part of her life, showing spite to it.\n\nMaeve was never one to live the noble life, her rebellious actions and crimes had her relinquished of her Noble status.\n\n(Noble players can recognise her.)",
					},
					["4"] = {
						["AC"] = true,
						["TI"] = "Armed.",
						["TX"] = "Concealed down her waist is a two-shot pistol, the main give away being the bandolier upon her upper chest, containing a few bullet containers.\n\nEven more obvious is the dagger sheathed down her hip.",
						["IC"] = "inv_legendary_gun",
