			["time"] = 1619227008,
			["link"] = {
				["Xetarus-ArgentDawn"] = 1,
			},
			["about"] = {
				["T2"] = {
					{
						["TX"] = "{h1:c}Past{/h1}\n\nMaeve was born and (mostly) raised in Kul Tiras, being birthed upon the noble house of Ludwidge, she lived most of her life under such ideals of pleasantries and easy living, until she got mixed with the wrong crowd, at this part of her life she was rather innocent, shy and easy to manipulate, she became close friends and soon lovers with a man a few years older than her, at first things seemed alright, she got introduced to his friends and they seemed like a nice bunch, but as time went by she slowly started to realise their true nature, and as such she was roped in, eventually the small friend group became a criminal gang. And Maeve felt overwhelming pressure to join, if only to fit in.\n\nAs time passed, her behaviour changed, the innocent Maeve was trapped and quelled in a rough, but fragile exterior - But it wasnt just her behaviour changing, over time her now boyfriend became aggressive to her, abusing her mentally and physically, her parents barely put any effort into trying to stop her from seeing them, despite the constant bruises she'd come home with. Eventually her parents disowned her after witnessing her commit a crime. Leaving her even more trapped in her situation.\n\nMany years would pass until she was a fully grown adult, her constant years of torment and peer pressure lead her to the boiling point, she eventually snapped on her boyfriend while they were out in Elwynn. Knocking him out with a blunt object and burying him alive just as he came to consciousness. The years of torment grew on her in that moment.\n\nShe now tries to live a normal life, but her past has left her scarred and fragile, yet reinforcing the tough exterior so she wouldn't find herself in a similar situation, she holds a bitter resentment to her family, yet only minorly switching her last name from Ludwidge to Ludwin.",
						["BK"] = 3,
						["IC"] = "ability_mage_timewarp",
					}, -- [1]
					{
						["TX"] = "{h1:c}Appearance & Traits {/h1}\n\n{h2:c}Appearance{/h2}\n\nMaeve is quite obviously in her younger years, her skin showing a notable lack of aging, she is often adorned in black lipstick and eyeliner, contrasting with her light pale skin tone to concoct a rather gothic look about her.\n\nHer hair is long and voluminous often waving in the wind, further up her head she has balled up her hair, more for style than convenience however as he fringe often falls upon her face, hanging down - yet tucked to the side.\n\nMaeve is often very covered up, either wearing darkly coloured robes or more comfortable long sleeve shirts, rarely is she ever wearing anything else, but there may be an occasion or two where she might.\n\n{h2:c}Traits{/h2}\n\nMaeve has a slight Kul Tiran accent, despite her best attempts to mask it with a more posher voice, it will occasionally break out when she's annoyed, stressed or just goofing around. She seems to hold a slight contempt to her heritage and is trying to distance herself from it.\n\nHer attitude often wavers, most of the time she is polite and open to talk, but if she feels uncomfortable or irritated it doesnt take a fool to notice the shift in her voice - in the way she talks, her expression.\n\nWith those she is close personally with she will often seem clingy and very defensive with them, this once more again relates to her past, having never had anyone to truly lean on she values such a privilege.",
						["BK"] = 3,
						["IC"] = "achievement_character_human_female",
